import React from 'react';
import syr from './syr.jpeg'
import hh from './hh.png'
function HomeContainer({ activeLink }) {
  // Define the content to display based on the active link
  let content;
  switch (activeLink) {
    case 'blog':
      content = <p className='ml-[520px] mt-10 text-lg font-baskerville font-medium'>Blog Content Goes Here</p>;
      break;
    case 'work':
      content = (    <div className='ml-[520px] mt-10 text-lg font-baskerville font-medium'>
      </div>)
      break;
      case 'about':
      content = (     <div className='flex flex-col ml-[520px] mt-10 text-lg font-baskerville font-medium'>
      <div className='font-medium'>
        <p>Education</p>
      </div>
      <div className='mt-10 flex items-center'>
        <img 
          className='w-28 h-26 rounded-full'
          src={syr}
          alt="Image"
        />   
        <div className='ml-4'>
          <p>M.S. Computer Science</p>
          <p className='mt-1 text-sm'>2021-2023</p>
        </div>
        <div>
          <p className='mt-[-23px] ml-20'>Syracuse, NY</p>
        </div>
      </div>

      <div className='mt-10'>
        <img 
          className='w-28 h-26 rounded-full'
          src={hh}
          alt="Image"
        />   
      </div>
    </div>)
      break;
    default:
      content = (<div className='ml-[520px] mt-10 text-lg font-baskerville font-medium'>
        I make User Friendly interfaces and designs to deliver best user experiences
        <br/>


        </div>);
  }

  return (
    <div className="common-container">
      {content}
    </div>
  );
}

export default HomeContainer;
